import React from 'react'
function TodoMain(props){
  return(
  <div>
    <input type="checkbox" checked={props.listitem.completed} onChange={function(){props.handle(props.listitem.id)}}/>
    <p>{props.listitem.name}</p>
  </div>
)
}

export default TodoMain
